import React from 'react';
import './matchData.css';
import { Container } from 'semantic-ui-react';

import FixtureList from './fixtureList';

const MatchData = (props) => ( 
    <Container style={{background: 'white', borderStyle: 'solid', borderColor: '#37003C', borderWidth: '3px', borderRadius: '8px', margin: '80px', padding: '10px'}}>
        <FixtureList fixtures={props.fixtures} round={props.round}/>
    </Container>
)

export default MatchData;
